import {Col,Card} from 'react-bootstrap';
import './onlineprojects.scss'

const OnlineProject = ({name,description,git,url}) => {
    return (
        <Col md="3">
            <Card>
                <div className="card-body">
                    <h4 className="text-center">{name}</h4>
                    <p className="text-center">{description}</p>
                   <div className="button-flex">
                   <a href={git} target="_blank"><button>View on Git</button></a>
                    <a href={url} target="_blank"><button>View Website</button></a>
                   </div>
                </div>
            </Card>
        </Col>
    )
}

export default OnlineProject;
